Storyline

The twenty-one year-old Timothy &quot;Tim&quot; Allen Russell is discharged from a mental institution by his psychiatric Dr. Shawn Graham completely healed from a childhood trauma. His sister Kaylie welcomes him in the parking area and brings him home. Then she tells that they need to destroy an ancient mirror that she has just bought in an auction. The reluctant Tim follows his sister and has fragmented recollections from his childhood, when his mother Marie buys a mirror for the home office of his father Alan. Kaylie and Tim see a woman with their father in his office and the behaviors of Alan and Marie change, ending in a family tragedy. Kaylie blames the mirror and now she wants to destroy it with Tim. Will they succeed?


